        public static string WssGetToken()
        {
            string URL = LeerParametros.URLWSSTOKEN;
            int reintentos = 5;
            HttpWebRequest req = null;
            WebResponse response = null;
            bool isOK = false;
            ConexionBD con = new ConexionBD();
            string[] d = con.RecuperaDatosToken();
            string iden_empr = d[0];
            string iden_auth = d[1];
            string pass_secu = d[2];
            byte[] base64 = System.Text.Encoding.UTF8.GetBytes(pass_secu);
            string pass_secu_Base64 = Convert.ToBase64String(base64);

            string RequestJsonToken = "{" +
                                        "\"GetToken\": {" +
                                        "\"IdentificadorEmpresa\": \""+ iden_empr + "\"," +
                                        "\"UsuarioEmpresa\":\""+ iden_auth + "\"," +
                                        "\"AutorizacionEmpresa\":\""+ pass_secu_Base64 + "\"" +
                                        "}" +
                                        "}";

            try
            {
                req = (HttpWebRequest)WebRequest.Create(URL);
                req.Headers.Add("SOAPAction", LeerParametros.URLWSSTOKEN);
                req.ContentType = "application/json";
                req.Accept = "text/xml";
                req.Method = "POST";

            }
            catch (Exception e)
            {
                throw e;
            }

            string soap = RequestJsonToken;

            while (reintentos > 0)
            {
                reintentos--;
                try
                {
                    using (Stream stm = req.GetRequestStream())
                    {
                        using (StreamWriter stmw = new StreamWriter(stm))
                        {
                            stmw.Write(soap);
                        }
                    }
                    response = req.GetResponse();
                    if (((HttpWebResponse)response).StatusCode != HttpStatusCode.OK)
                    {
                        Thread.Sleep(1000);
                    }
                    else
                    {
                        isOK = true;
                        break;
                    }
                }
                catch (System.Net.WebException ex)
                {
                    throw new Exception("Error al ejecutar " + URL + "   " + ex);
                }
                catch (Exception)
                {
                    throw new Exception("Error al ejecutar " + URL);
                }

            }
            if (!isOK)
            {
                throw new Exception("Error al ejecutar " + URL);
            }
            string content;
            using (StreamReader reader = new StreamReader(response.GetResponseStream()))
            {
                content = reader.ReadToEnd();
            }
            var json = JObject.Parse(content);
            var message = (string)json["Token"];
            return message;

        }

